import React from 'react';
import Footer from '../components/footer';

const LoginPage = () => {
  return (
    <div className="flex h-screen">
      <div className="flex flex-col justify-center w-1/2 pl-8">
        <h1 className="text-left text-5xl font-bold mb-4">Volunteer Management System</h1>
      </div>
      <div className="flex flex-col justify-center w-300 pr-8">
        <form className="bg-clip-border p-6 bg-[#fef6d8] rounded-2xl shadow-2xl">
          <div className="mb-4">
            <input className="w-2/3 h-14 px-3 py-2 border rounded-xl " type="email" placeholder="Email" />
          </div>
          <div className="mb-4">
            <input className="w-2/3 h-14 px-3 py-2 border rounded-xl" type="password" placeholder="Password" />
          </div>
          <div className="flex space-x-4 mb-4">
            <button className="w-1/3 h-14 bg-[#fcd137] text-black font-bold py-2 px-4 rounded-xl">Log In</button>
            <button className="w-1/3 h-14 bg-[#fcd137] text-black font-bold py-2 px-4 rounded-xl">Sign Up</button>
          </div>
          <a className="block text-left text-slate-400 mb-10" href="#">Forgot Password?</a>
        </form>
      </div>

    </div>
  );
};

export default LoginPage;
